module.exports=[{content:"You will never be happy if you continue to search for what happiness consists of. You will never live if you are looking for the meaning of life.",by:"Albert Camus"},{content:"You will never be happy if you continue to search for what happiness consists of. You will never live if you are looking for the meaning of life.",by:"Albert Camus"},{content:"Just know, when you truly want success, you’ll never give up on it. No matter how bad the situation may get.",by:"Unknown"},{content:"Accept responsibility for your life. Know that it is you who will get you where you want to go, no one else.",by:"Les Brown"},{content:"I don’t regret the things I’ve done, I regret the things I didn’t do when I had the chance.",by:"Unknown"},{content:"Challenges are what make life interesting and overcoming them is what makes life meaningful.",by:"Joshua J. Marine"},{content:"Its hard to wait around for something you know might never happen; but its harder to give up when you know its everything you want.",by:"Unknown"},{content:"One of the most important keys to Success is having the discipline to do what you know you should do, even when you dont feel like doing it.",by:"Unknown"},{content:"Good things come to those who wait… greater things come to those who get off their ass and do anything to make it happen.",by:"Unknown"},{content:"Happiness cannot be traveled to, owned, earned, or worn. It is the spiritual experience of living every minute with love, grace &amp; gratitude.",by:"Denis Waitley"},{content:"In order to succeed, your desire for success should be greater than your fear of failure.",by:"Bill Cosby"},{content:"Go where you are celebrated – not tolerated. If they can’t see the real value of you, it’s time for a new start.",by:"Unknown"},{content:"Dont be afraid to stand for what you believe in, even if that means standing alone.",by:"Unknown"},{content:"The best revenge is massive success.",by:"Unknown"},{content:"Forget all the reasons it won’t work and believe the one reason that it will.",by:"Unknown"},{content:"I am thankful for all of those who said NO to me. Its because of them I’m doing it myself.",by:"Albert Einstein"},{content:"The only way to do great work is to love what you do. If you haven’t found it yet, keep looking. Don’t settle.",by:"Steve Jobs"},{content:"Life is short, live it. Love is rare, grab it. Anger is bad, dump it. Fear is awful, face it. Memories are sweet, cherish it.",by:"Unknown"},{content:"When you say “It’s hard”, it actually means “I’m not strong enough to fight for it”. Stop saying its hard. Think positive!",by:"Unknown"},{content:"Life is like photography. You need the negatives to develop.",by:"Unknown"},{content:"Don’t worry about failures, worry about the chances you miss when you don’t even try.",by:"Jack Canfield"},{content:"The pain you feel today is the strength you feel tomorrow. For every challenge encountered there is opportunity for growth.",by:"Unknown"},{content:"Build your own dreams, or someone else will hire you to build theirs.",by:"Farrah Gray"},{content:"The only thing that stands between you and your dream is the will to try and the belief that it is actually possible.",by:"Joel Brown"},{content:"Self confidence is the most attractive quality a person can have. how can anyone see how awesome you are if you can’t see it yourself?",by:"Unknown"},{content:"We learn something from everyone who passes through our lives.. Some lessons are painful, some are painless.. but, all are priceless.",by:"Unknown"},{content:"Being happy doesn’t mean that everything is perfect. it means that you’ve decided to look beyond the imperfections.",by:"Unknown"},{content:"Nobody ever wrote down a plan to be broke, fat, lazy, or stupid. Those things are what happen when you don’t have a plan.",by:"Larry Winget"},{content:"Three things you cannot recover in life: the WORD after it’s said, the MOMENT after it’s missed and the TIME after it’s gone. Be Careful!",by:"Unknown"},{content:"Though no one can go back and make a brand new start, anyone can start from now and make a brand new ending.",by:"Carl Bard"},{content:"When the past calls, let it go to voicemail, believe me, it has nothing new to say.",by:"Unknown"},{content:"Rule #1 of life. Do what makes YOU happy.",by:"Unknown"},{content:"Walk away from anything or anyone who takes away from your joy. Life is too short to put up with fools.",by:"Unknown"},{content:"Love what you have. Need what you want. Accept what you receive. Give what you can. Always remember, what goes around, comes around…",by:"Unknown"},{content:"Just remember there is someone out there that is more than happy with less than what you have.",by:"Unknown"},{content:"The biggest failure you can have in life is making the mistake of never trying at all.",by:"Unknown"},{content:"Life has two rules: #1 Never quit #2 Always remember rule # 1.",by:"Unknown"},{content:"No one is going to hand me success. I must go out &amp; get it myself. That’s why I’m here. To dominate. To conquer. Both the world, and myself.",by:"Unknown"},{content:"Take wrong turns. Talk to strangers. Open unmarked doors. And if you see a group of people in a field, go find out what they are doing. Do things without always knowing how they’ll turn out.",by:"Randall Munroe"},{content:"Life can only be understood backwards; but it must be lived forwards.",by:"Søren Kierkegaard"},{content:"Beware the barrenness of a busy life.",by:"Socrates"},{content:"Life is beautiful, as long as it consumes you. When it is rushing through you, destroying you, life is gorgeous, glorious. It’s when you burn a slow fire and save fuel, that life’s not worth having.",by:"D. H. Lawrence"},{content:"Learn how to be happy with what you have while you pursue all that you want.",by:"Jim Rohn"},{content:"The happiness of your life depends upon the quality of your thoughts: therefore, guard accordingly, and take care that you entertain no notions unsuitable to virtue and reasonable nature.",by:"Aurelius, Marcus"},{content:"I do not exist to impress the world. I exist to live my life in a way that will make me happy.",by:"Richard Bach"},{content:"Success is not the key to happiness. Happiness is the key to success. If you love what you are doing, you will be successful.",by:"Albert Shweitzer"},{content:"I rejoice in life for its own sake. Life is no ‘brief candle’ for me. It is a sort of splendid torch which I have got hold of for the moment, and I want to make it burn as brightly as possible before handing it on to future generations.",by:"G.B. Shaw"},{content:"Each morning when I open my eyes I say to myself; I, not events, have the power to make me happy or unhappy today. I can choose which it shall be. Yesterday is dead, tomorrow hasn’t arrived yet. I have just one day, today, and I’m going to be happy in it.",by:"Groucho Marx"},{content:"Don’t cry because it’s over, smile because it happened.",by:"Dr. Seuss"},{content:"If you want to be happy, be.",by:"Leo Tolstoy"},{content:"Look at the trees, look at the birds, look at the clouds, look at the stars… Everything is simply happy. Trees are happy for no reason; they are not going to become presidents and they are not going to become rich. It is simply unbelievable how happy flowers are.",by:"Osho"},{content:"Look at the trees, look at the birds, look at the clouds, look at the stars… Everything is simply happy. Trees are happy for no reason; they are not going to become presidents and they are not going to become rich. It is simply unbelievable how happy flowers are.",by:"Logan Pearsall Smith"}];